import './base.css';
import React, { useState, useEffect } from 'react';
import { setState, setRotation } from './redux/appSlice';
import { useSelector, useDispatch } from 'react-redux';
import axios from 'axios';
import GoogleMapReact from 'google-map-react';

const apikey = "AIzaSyC9qsxaC4dHG0ibEr9NMKC9Ddro_jdnMk8";

const handleApiLoaded = (map, maps) => {
    const defaultProps = {
        center: {
          lat: 10.99835602,
          lng: 77.01502627
        },
        zoom: 11
      };

    let pyrmont = new window.google.maps.LatLng(-33.8665433, 151.1956316);
    let callback;
    let mappo = new window.google.maps.Map(document.getElementById('map'), {
        center: pyrmont,
        zoom: 15
    });

    var request = {
        location: pyrmont,
        radius: '500',
        type: ['restaurant']
    };

    let service = new window.google.maps.places.PlacesService(mappo);
    service.nearbySearch(request, callback);

};

function gMap() {

    const defaultProps = {
        center: {
          lat: 10.99835602,
          lng: 77.01502627
        },
        zoom: 11
      };

    return (
        // Important! Always set the container height explicitly
        <div style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                bootstrapURLKeys={{ key: {apikey} }}
                defaultCenter={this.props.center}
                defaultZoom={this.props.zoom}
                yesIWantToUseGoogleMapApiInternals
                onGoogleApiLoaded={({ map, maps }) => handleApiLoaded(map, maps)}
            >
            </GoogleMapReact>
        </div>

    );
}

export default gMap;
